import React from 'react';
import './App.css';
import Button from "./components/UI/Button";
import Input from "./components/UI/Input";
import Frame from './components/UI/Frame';

function App() {
  return (
    <div>
      <Frame>
        <Input name={'Username'}/>
        <Input name={'Age'}/>
        <Button name={"Add"}/>
      </Frame>    
    </div>
  );
}

export default App;
